import React from "react";
import EditPlus from "../EditPlus";
import "./Frame11.css";

function Frame11(props) {
  const { text111, editPlusProps, className } = props;

  return (
    <div className={`frame-11 ${className || ""}`}>
      <EditPlus editPlus={editPlusProps.editPlus} className="basic-checkboxchecked" />
      <p className="text-111">{text111}</p>
    </div>
  );
}

export default Frame11;
